import React, { Component } from "react";
import styled from "styled-components";

const ImagePart = styled.div`
    width: 150px;
    height: 150px;
    background-color: #D6D6D6;
    border-radius: 50%;
    position: absolute;
    top:171px;
    left:9px;
    & img {
      width: 100%;
      height: 100%;
    }
`;

const TextGruop = styled.div`
    width: 527px;
    height: 130px;
    background-color:#EFEFEF;
    border-radius: 15px 15px 15px 15px;
    position: absolute;
    top:181px;
    left:69px;
`;



class Designer extends Component{
    render(){
        const designer = this.props.data;
        return(
            <div>
                <TextGruop>
                    <div className="userName" style={{top:"15px", left:"114px", position:"absolute", size:"20px", color:"#707070"}}>찬호찬호</div>
                    <div className="description" style={{top:"51px", left:"114px", position:"absolute", size:"20px", color:"#707070"}}>descript </div>
                    <div className="cate" style={{top:"15px", left:"462px", position:"absolute", fontsize:"40px", color:"#FF0000"}}>패션</div>
                </TextGruop>
                <ImagePart/>
            </div>

        )
    }

}
export default Designer
